import {
  FETCH_PROJECTS_FOR_GALLERY,
} from '../../../utils/constants';

export const defaultState = {
  projectsFound: [],
  project: {}
};

const projectGallery = (state = defaultState, action) => {
  switch (action.type) {
    case FETCH_PROJECTS_FOR_GALLERY:
      return {
        ...state,
        projectsFound: action.payload,
      };
    default:
      return state;
  }
};

export default projectGallery;
